document.addEventListener('DOMContentLoaded', function () {
    // Получаем элементы
    var modal = document.getElementById("myModal");
    var dalilBtn = document.getElementById("dalil");
    var span = document.getElementsByClassName("close")[0];
    var dalilButton = document.querySelector('.dalilButton');

    // Открываем модальное окно при клике на изображение
    dalilBtn.onclick = function () {
        modal.style.display = "block";
    }

    // Закрываем модальное окно при клике на <span> (x)
    span.onclick = function () {
        modal.style.display = "none";
    }

    // Закрываем модальное окно при клике вне его
    window.onclick = function (event) {
        if (event.target == modal) {
            modal.style.display = "none";
        }
    }

    // Убираем анимацию через 5 секунд
    setTimeout(function () {
        dalilButton.classList.add('no-blink');
    }, 5000);

    var switchButton = document.querySelector('.switchButton');

    switchButton.addEventListener('click', function () {
        var elementsToHide = ['.tahajjud', '.sunrise', '.ishrok', '.duha', '.zenith', '.sunset'];
        elementsToHide.forEach(function (selector) {
            var element = document.querySelector(selector);
            if (element) {
                element.style.display = 'none';
            }
        });
    });
});

document.addEventListener('DOMContentLoaded', function () {
    var switchButton = document.querySelector('.switchButton');
    var elementsToToggle = ['.tahajjud', '.sunrise', '.ishrok', '.duha', '.zenith', '.sunset'];
    var isHidden = false;

    var switchImg = document.getElementById('switchToNafil');
    switchImg.classList.add('blinking');

    setTimeout(function () {
        switchImg.classList.remove('blinking');
    }, 5000);

    switchButton.addEventListener('click', function () {
        elementsToToggle.forEach(function (selector) {
            var element = document.querySelector(selector);
            if (element) {
                element.style.display = isHidden ? 'grid' : 'none';
            }
        });
        isHidden = !isHidden;  // Переключаем состояние
    });
});

function updateDate() {
    const now = new Date();
    let day = now.getDate().toString().padStart(2, '0');
    let month = (now.getMonth() + 1).toString().padStart(2, '0');
    let year = now.getFullYear();

    const currentDateElement = document.querySelector('.currentYear');
    if (currentDateElement) {
        currentDateElement.textContent = `${day}.${month}.${year}`;
    } else {
        console.error("Элемент с классом 'currentYear' не найден.");
    }
}

setInterval(updateDate, 1000);

function updateTime() {
    const now = new Date();
    let hours = now.getHours().toString().padStart(2, '0');
    let minutes = now.getMinutes().toString().padStart(2, '0');
    let seconds = now.getSeconds().toString().padStart(2, '0');

    const currentTimeElement = document.querySelector('.currentTime');
    if (currentTimeElement) {
        currentTimeElement.textContent = `${hours}:${minutes}:${seconds}`;
    } else {
        console.error("Элемент с классом 'currentTime' не найден.");
    }
}

updateTime();
setInterval(updateTime, 1000);

function updateNamazTimes() {
    const now = new Date();
    const today = now.getDate().toString().padStart(2, '0') + '.' +
        (now.getMonth() + 1).toString().padStart(2, '0') + '.' +
        now.getFullYear();

    const todayNamazTimes = namazTimes.find(times => times["366days"] === today);

    if (todayNamazTimes) {
        document.querySelector('.fajrStart').textContent = todayNamazTimes.fajrStart;
        document.querySelector('.fajrEnd').textContent = todayNamazTimes.fajrIkomat; // Изменено
        document.querySelector('.sunriseStart').textContent = todayNamazTimes.sunriseStart;
        document.querySelector('.sunriseEnd').textContent = todayNamazTimes.sunriseEnd;
        document.querySelector('.ishrokStart').textContent = todayNamazTimes.ishrokStart;
        document.querySelector('.ishrokEnd').textContent = todayNamazTimes.ishrokEnd;
        document.querySelector('.duhaStart').textContent = todayNamazTimes.duhaStart;
        document.querySelector('.duhaEnd').textContent = todayNamazTimes.duhaEnd;
        document.querySelector('.zenithStart').textContent = todayNamazTimes.zenithStart;
        document.querySelector('.zenithEnd').textContent = todayNamazTimes.zenithEnd;
        document.querySelector('.zuhrStart').textContent = todayNamazTimes.zuhrStart;
        document.querySelector('.zuhrEnd').textContent = todayNamazTimes.zuhrIkomat; // Изменено
        document.querySelector('.asrStart').textContent = todayNamazTimes.asrStart;
        document.querySelector('.asrEnd').textContent = todayNamazTimes.asrIkomat; // Изменено
        document.querySelector('.sunsetStart').textContent = todayNamazTimes.sunsetStart;
        document.querySelector('.sunsetEnd').textContent = todayNamazTimes.sunsetEnd;
        document.querySelector('.magribStart').textContent = todayNamazTimes.magribStart;
        document.querySelector('.magribEnd').textContent = todayNamazTimes.magribIkomat; // Изменено
        document.querySelector('.ishaStart').textContent = todayNamazTimes.ishaStart;
        document.querySelector('.ishaEnd').textContent = todayNamazTimes.ishaIkomat; // Изменено
        document.querySelector('.tahajjudStart').textContent = todayNamazTimes.tahajjudStart;
        document.querySelector('.tahajjudEnd').textContent = todayNamazTimes.tahajjudEnd;
    } else {
        console.error("Время намаза для текущей даты не найдено.");
    }
}

document.addEventListener('DOMContentLoaded', updateNamazTimes);

