document.addEventListener('DOMContentLoaded', function () {
    function updateTime() {
        updateTimer('.tahajjudEnd', '.tahajjudEndLeft', 'tahajjud');
        updateTimer('.tahajjudStart', '.tahajjudStartLeft', 'tahajjud', true);

        updateTimer('.fajrEnd', '.fajrEndLeft', 'fajr');
        updateTimer('.fajrStart', '.fajrStartLeft', 'fajr', true, 'tahajjud');

        updateTimer('.sunriseEnd', '.sunriseEndLeft', 'sunrise');
        updateTimer('.sunriseStart', '.sunriseStartLeft', 'sunrise', true, 'fajr');

        updateTimer('.ishrokEnd', '.ishrokEndLeft', 'ishrok');
        updateTimer('.ishrokStart', '.ishrokStartLeft', 'ishrok', true, 'sunrise');

        updateTimer('.duhaEnd', '.duhaEndLeft', 'duha');
        updateTimer('.duhaStart', '.duhaStartLeft', 'duha', true, 'ishrok');

        updateTimer('.zenithEnd', '.zenithEndLeft', 'zenith');
        updateTimer('.zenithStart', '.zenithStartLeft', 'zenith', true, 'duha');

        updateTimer('.zuhrEnd', '.zuhrEndLeft', 'zuhr');
        updateTimer('.zuhrStart', '.zuhrStartLeft', 'zuhr', true, 'zenith');

        updateTimer('.asrEnd', '.asrEndLeft', 'asr');
        updateTimer('.asrStart', '.asrStartLeft', 'asr', true, 'zuhr');

        updateTimer('.sunsetEnd', '.sunsetEndLeft', 'sunset');
        updateTimer('.sunsetStart', '.sunsetStartLeft', 'sunset', true, 'asr');

        updateTimer('.magribEnd', '.magribEndLeft', 'magrib');
        updateTimer('.magribStart', '.magribStartLeft', 'magrib', true, 'sunset');

        updateTimer('.ishaEnd', '.ishaEndLeft', 'isha');
        updateTimer('.ishaStart', '.ishaStartLeft', 'isha', true, 'magrib');

        resetIshaAtFajr('.fajrStart', 'isha', 'magrib');
    }

    function updateTimer(timeSelector, countdownSelector, className, start = false, endClass = null) {
        const timeElement = document.querySelector(timeSelector).textContent;
        const timeParts = timeElement.split(':');
        const targetTime = new Date();
        targetTime.setHours(parseInt(timeParts[0]), parseInt(timeParts[1]), 0, 0);

        const now = new Date();
        let difference = targetTime - now;

        const parentDiv = document.querySelector('.' + className);
        const allDivs = parentDiv.querySelectorAll('*');

        if (start && difference > 0) {
            const hours = Math.floor(difference / 3600000);
            const minutes = Math.floor((difference % 3600000) / 60000);
            const seconds = Math.floor((difference % 60000) / 1000);

            const timeString = `${hours}:${minutes < 10 ? '0' + minutes : minutes}:${seconds < 10 ? '0' + seconds : seconds}`;
            document.querySelector(countdownSelector).innerHTML = `${timeString}`;
        } else if (start && difference <= 0) {
            allDivs.forEach(div => div.style.backgroundColor = 'lightgreen');
            document.querySelector(countdownSelector).textContent = "";

            if (endClass) {
                const endParentDiv = document.querySelector('.' + endClass);
                const endAllDivs = endParentDiv.querySelectorAll('*');
                endAllDivs.forEach(div => div.style.backgroundColor = '');
            }
        }

        if (!start && difference <= 0) {
            allDivs.forEach(div => div.style.backgroundColor = '');
            document.querySelector(countdownSelector).textContent = "";
        } else if (!start && difference > 0) {
            const hours = Math.floor(difference / 3600000);
            const minutes = Math.floor((difference % 3600000) / 60000);
            const seconds = Math.floor((difference % 60000) / 1000);

            const timeString = `${hours}:${minutes < 10 ? '0' + minutes : minutes}:${seconds < 10 ? '0' + seconds : seconds}`;
            document.querySelector(countdownSelector).innerHTML = `${timeString}`;
        }
    }

    function resetIshaAtFajr(fajrStartSelector, ishaClass, magribClass) {
        const fajrStartElement = document.querySelector(fajrStartSelector).textContent;
        const fajrStartParts = fajrStartElement.split(':');
        const fajrStartTime = new Date();
        fajrStartTime.setHours(parseInt(fajrStartParts[0]), parseInt(fajrStartParts[1]), 0, 0);

        const now = new Date();
        let difference = fajrStartTime - now;

        if (difference <= 0) {
            const ishaParentDiv = document.querySelector('.' + ishaClass);
            const ishaAllDivs = ishaParentDiv.querySelectorAll('*');
            ishaAllDivs.forEach(div => div.style.backgroundColor = '');

            const magribParentDiv = document.querySelector('.' + magribClass);
            const magribAllDivs = magribParentDiv.querySelectorAll('*');
            magribAllDivs.forEach(div => div.style.backgroundColor = '');
        }
    }

    updateTime();
    setInterval(updateTime, 1000);
});


document.addEventListener("DOMContentLoaded", function () {
    function updatePrayerTimes() {
        const currentTime = new Date();
        const hours = currentTime.getHours();
        const minutes = currentTime.getMinutes();
        const seconds = currentTime.getSeconds();
        const formattedTime = `${hours.toString().padStart(2, '0')}:${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')}`;

        const magribStart = document.getElementById('magribStart').innerText;
        const magribEnd = document.getElementById('ishaStart').innerText;
        const ishaStart = document.getElementById('ishaStart').innerText;
        const ishaEnd = '23:59:59'; // Конец времени Иша в 23:59:59

        // Функция для проверки, находится ли текущее время в диапазоне
        function isTimeInRange(start, end, current) {
            return current >= start && current <= end;
        }

        // Обновляем классы для Магриба
        const magribElement = document.getElementById('magrib');
        if (isTimeInRange(magribStart, magribEnd, formattedTime)) {
            magribElement.classList.add('highlight');
        } else {
            magribElement.classList.remove('highlight');
        }

        // Обновляем классы для Иша
        const ishaElement = document.getElementById('isha');
        if (isTimeInRange(ishaStart, ishaEnd, formattedTime)) {
            ishaElement.classList.add('highlight');
        } else {
            ishaElement.classList.remove('highlight');
        }
    }

    // Обновляем время каждую секунду
    setInterval(updatePrayerTimes, 1000);
});

